import React from 'react';


function Hangman() {
    window.addEventListener("load", () => {
        const canvas = document.querySelector('#canvas');
        const ctx = canvas.getContext('2d');
        firstMark(ctx);
        secondMark(ctx);
        thirdMark(ctx);
        // Staring point (10,45)
        ctx.moveTo(50,40);
        // End point (180,47)
        ctx.lineTo(50,50);
        // Make the line visible
        ctx.stroke();
    })

    return (
    <div className="App">
        <canvas id="canvas"></canvas>
    </div>
    );
}

function firstMark(ctx) {
    ctx.moveTo(10,130);
    ctx.lineTo(40,130);
    ctx.stroke();
}

function secondMark(ctx) {
    ctx.moveTo(25,40);
    ctx.lineTo(25,130);
    ctx.stroke();
}

function thirdMark(ctx) {
     ctx.moveTo(25,40);
     ctx.lineTo(60,40);
     ctx.stroke();
}

export default Hangman;
